import React from "react";
import ForcastCard from "components/ForcastCard";
const HourlyForcast = (props) => {
  const { hourly } = props;
  return (
    <ul>
      {hourly.data.slice(0, 23).map((item,key) => (
        <li key={key}>
          <ForcastCard type="hourly" temp={item.temperature} icon={item.icon} title={item.time} />
        </li>
      ))}
    </ul>
  );
};
export default HourlyForcast;
